import React, {Component} from 'react'
import classes from './Layout.module.css'

console.log(classes)

class Layout extends Component {
    render() {
    	return (
    		<div className={classes.Layout}>
    		  <main className={classes['Layout main']}>
    		    {this.props.children}
    		  </main>
    		</div>
    	)
    }



}

export default Layout
